import (
	context "context"
	rapiddocsclient "github.com/bearer-token-environment-variable/rapiddocs/client"
	option "github.com/bearer-token-environment-variable/rapiddocs/option"
)

client := rapiddocsclient.NewClient(
	option.WithApiKey(
		"<YOUR_AUTH_TOKEN>",
	),
)
response, err := client.Service.GetWithBearerToken(
	context.TODO(),
)
